Gleam is a statically typed functional programming language for building scalable concurrent systems. It compiles to Erlang and has straightforward interop with other BEAM languages such as Erlang, Elixir and LFE. It looks like this: pub enum Tree = | Leaf(Int) | Node(Tree, Tree) pub fn any(tree, predicate) { case tree { | Leaf(i) -> predicate(i) | Node(left, right) -> any(left, predicate) || any(right, predicate) }
} pub fn has_even_leaf(tree) { any(tree, fn(i) { i % 2 == 0 })
} The source code can be found at https://github.com/lpil/gleam . For Gleam chat we have the IRC channel #gleam-lang on Freenode.

