Gleam programs are made up of bundles of functions and types called modules. Each module has its own namespace and can export types and values to be used by other modules in the program. // inside src/rocket_ship.gleam fn count_down() { "3... 2... 1..."
} fn blast_off() { "BOOM!"
} pub fn launch() { [ count_down(), blast_off(), ]
} Here we can see a module named rocket_ship , the name determined by the filename src/rocket_ship.gleam . For the functions count_down and blast_off we have omitted the pub keyword, so these functions are private module functions. They can only be called by other functions within the same module.

