Modules in Gleam are first class values and can be assigned to variables, passed to functions, or anything else that we can do with regular values. import rocket_ship
import new_website
import navy_boat pub fn perform_launch(some_module) { some_module:launch()
} pub fn run() { perform_launch(rocket_ship) perform_launch(new_website) perform_launch(navy_boat)
} Here we have define a function that takes a module as an argument and then called it with various different modules. The perform_launch function doesn't care what module it takes, so long as it has a public function called launch that takes no arguments.

