The type of a map depends upon the names and types of its fields. { name = "Rex" } // Type { name = String }
{ name = "Rex", size = 40 } // Type { name = String, size = Int } The Gleam compiler keeps tracks of what fields and values each map has and will present a compile time error if you try to use a map field that does not exist or has the incorrect type. let pup = { name = "Rex", size = 40 } pup.address // Compile time error! Unknown field
pup.name + 1 // Compile time error! Wrong type

